import React from "react";
import "./styles.css";
import SearchForm from "../SearchForm";
import NewsCardList from "../NewsCardList";
import About from "../About";

function Main() {
  return (
    <main className="main">
      <SearchForm />
      <NewsCardList />
      <About />
    </main>
  );
}

export default Main;
